import React from "react";
import styles from "./SectionsContainer.module.css";
import Icons from '../../assets/icons/icons';
import CustomButton from '../../utils/CustomButton'
export default function Section3(){
    const boxes = ['Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów']
    const listItems = boxes.map((box, index) =>
   
    <ListItem value={box} number={index+1} styleName={index=1? '':''}/>
  );

    return(
        <div class="container" style={{position:'relative', padding:'100px 0px', marginTop:'100px'}}>
            <div class="row d-flex justify-content-around"style={{height:'300px'}} >
            {listItems}
            </div>
<div class="row">
  <div class="col-2 m-auto w-100 mt-5"><CustomButton title={'Więcej o ofercie'}/></div></div>
        </div>
    )
}
function ListItem(props) {
    return (
      <>
      
      <div  className={`col-md-2  ${ props.number==1?'col-md-offset-1':'' }  ${ props.number%2==0?'odd-cell':'even-cell' }`} >
          <div class="grey-box">
          <h1>#{props.number}</h1>
            <p>{props.value}</p>
            <Icons icon="square" width='20' height='20' />
          </div>
    </div>
     </>
    );
  }
